sql_query.sql:
SELECT DISTINCT ON (X.theme_sort_column) * FROM "theme_fields" JOIN (
          SELECT 2 AS theme_id, 0 AS theme_sort_column
        ) as X ON X.theme_id = theme_fields.theme_id JOIN (
        SELECT * FROM (VALUES ('en_US',0),('en',1)) as Y (locale_code, locale_sort_column)
      ) as Y ON Y.locale_code = theme_fields.name WHERE "theme_fields"."theme_id" = 2 AND "theme_fields"."target_id" = 4 AND "theme_fields"."name" IN ('en_US', 'en') ORDER BY X.theme_sort_column, Y.locale_sort_column
